INSERT INTO `journals` (`id`, `user_id`, `kategori_id`, `title`, `content`, `slug`, `thumbnail`, `created_at`, `updated_at`) VALUES
(1, 1, 2, 'Persiapan Mengajar Kelas 6a', '<ol><li>List siswa underlow</li><li>list siswa low</li><li>list siswa pass</li><li>list siswa high</li></ol><p>Strategi:</p><ol><li>diferensiasi lembar kerja siswa sesuai dengan kelompok siswa</li><li>siswa tetap diatur di dalam satu ruangan kelas yang sama</li></ol>', 'persiapan-mengajar-kelas-6a', '3035FOTO SISWA.png', '2022-05-17 17:17:43', '2022-05-30 19:05:46'),
(2, 1, 1, 'Pendampingan Kepala Sekolah', '<h1>Rencana Kerja Kepala Sekolah</h1><h4>SD Inpres Dabolding</h4><p>Menyusun 4W1H RKKS:</p><table class=\"table table-bordered\"><tbody><tr><td>Kegiatan</td><td>Mulai</td><td>Selesai</td></tr><tr><td>Pemetaan gap analysis</td><td>12 Juli 2022</td><td><p>18 Juli 2022</p></td></tr><tr><td>Diskusi resources</td><td>19 Juli 2022</td><td>19 Juli 2022</td></tr></tbody></table><p style=\"margin-left: 25px;\">Menjelaskan kepada kepala sekolah untuk membuat visi dan misi sekolah.</p><p style=\"margin-left: 25px;\"><br></p><p><img src=\"data:image/png;base64,\" style=\"width: 426.998px;\" data-filename=\"1.png\"></p><p><iframe frameborder=\"0\" src=\"//www.youtube.com/embed/u8fqwH3jTHY\" width=\"640\" height=\"360\" class=\"note-video-clip\"></iframe><br></p><p><br></p>', 'pendampingan-kepala-sekolah', '1131FOTO SISWA.png', '2022-04-13 21:45:30', '2022-05-19 21:25:58'),
(3, 1, 1, 'Jurnal Belajar Kelas 5', '<p>Ini merupakan jurnal belajar 1.</p>', 'jurnal-belajar-kelas-5', '1345FOTO SISWA.png', '2022-05-18 23:23:29', '2022-05-19 21:26:08'),
(4, 1, 1, 'Pengisian Raport Siswa', '<h1><b style=\"\"><font color=\"#ff0000\">Target Capaian Hari ini</font></b></h1><p>Hal yang harus dilakukan hari ini:</p><ol><li>mengisi daftar hadir</li><li>mengisi daftar nilai</li><li>membuat grafik kehadiran</li><li>membuat grafik nilai per mata pelajaran</li><li>menginput nilai harian siswa</li></ol><p><img src=\"data:image/png;base64,\" style=\"width: 426.998px;\" data-filename=\"1.png\"></p><p>Demikian terima kasih.</p>', 'pengisian-raport-siswa', '7411FOTO SISWA.png', '2022-05-18 23:26:48', '2022-05-19 20:43:37'),
(5, 1, 2, 'Jurnal Mengajar', '<h1>Jurnal Mengajar</h1><p>Target hari ini:</p><ol><li>mengisi data kehadiran siswa</li><li>membuat kisi-kisi soal LKS</li><li>mencetak LKS</li></ol><p><br></p>', 'jurnal-mengajar', 'C:\\xampp\\tmp\\php6729.tmp', '2022-05-19 16:42:57', '2022-05-19 16:42:57');
