INSERT INTO `postings` (`id`, `title`, `image`, `description`, `created_at`, `updated_at`) VALUES
(1, 'Menjelajahi ruang angkasa', '82111.png', 'Kami menemukan ruang angkasa yang diliputi gulita.\r\nCahaya bertebaran di mana-mana.', '2022-03-25 05:25:15', '2022-03-25 05:25:15'),
(2, 'Posting kedua', '20331.png', 'Deskripsi posting kedua', '2022-03-25 05:28:14', '2022-03-25 05:28:14'),
(3, 'Persekutuan Doa', '28473.png', 'Menjadi manusia baru.', '2022-03-25 13:38:06', '2022-03-25 13:38:06'),
(4, 'Posting kelima', '79932.png', 'Menyerukan perdamaian. Siswa melakukan pemetaan asset (manusia, adat, dan alam lingkungan). Bersama guru, siswa terekspos dengan realita. Mereka bersama-sama mencatat data, mamakai data yang dicatat, mengorganisasikan dan meninjau apakah data sudah cukup lengkap untuk mendapatkan peta realitas. Siswa mampu melakukan survey asset dan kebutuhan, kondisi riil di kampung. Misalnya, siswa mengkaji dusun, kebun, ternak, tanaman, kualitas tanah, luas lahan, sekaligus memetakan barang-barang apa yang bisa dikembangkan, dan memperkirakan potensi ekonominya. SMKN-O memberikan ruang sebesar-besarnya bagi siswa untuk belajar tentang bagaimana aset alam dikelola, baik secara tradisional maupun dengan teknologi modern, mulai dari teknologi tradisional dalam budaya Papua sampai teknologi modern untuk pengelolaan aset itu. Siswa belajar secara hands-on (praktek) tahapan-tahapan penting proses pengembangan teknologi dengan bebagai macam skala. Dan siswa mengerti untuk menerapkan prinsip dan proses untuk aset yang berbeda. Strategi ini cocok untuk mengakomodasi semua jurusan keahlian yang ada di SMKN-O, bahkan ada topik-topik baru yang dibutuhkan, seperti misalnya merancang sistem-proses-ukur analisis data dan problem, dan banyak lagi.', '2022-03-25 13:52:11', '2022-05-21 12:05:21');
